    <script type="text/javascript">
    
        // vwf.node.constructed = function() { jQuery( "#vwf-root" ).append( "<div><p>" + nodeToPath( this ) + "</p></div>" ) }

        var enterpriseNodeID = 1;
        var enterpriseActive = true;
        var enterpriseSuspendedAt = 0;

        var mouseDownTime1 = mouseDownTime2 = 0;

        var enterpriseAngle = 0;

        var time = lastTime = 0;

        var timeSetter = function (t) {

            lastTime = time;
            time = t;

            if (enterpriseSuspendedAt > 0 && time - enterpriseSuspendedAt > 500) {
                enterpriseSuspendedAt = 0;
                mouseDownTime1 = mouseDownTime2 = 0;
            }

            if (enterpriseActive && enterpriseSuspendedAt == 0) {
                enterpriseAngle += (time - lastTime) * 0.02;
                if (enterpriseAngle > 360)
                    enterpriseAngle -= 360;
            }
       }

        var enabledSetter = function (nodeID, enabled) {
            if (nodeID == enterpriseNodeID)
                enterpriseActive = enabled;
        }

        var angleSetter = function (nodeID, angle) {
            if (nodeID == enterpriseNodeID)
                enterpriseAngle = angle;
         }

        $(document).ready(function () {
            vwf.addEngine(new vwf.webgl(vwf, { tick: timeSetter, enabled: enabledSetter, angle: angleSetter }));
            vwf.addEngine(new vwf.html(vwf, "#vwf-root"));
            vwf.addEngine(new vwf.js(vwf));
            vwf.initialize();
        })

        // function nodeToPath( node ) { var path = ""; while ( node && node.name ) { path = node.name + "." + path; node = node.parent; } return path; }

    </script>

    <script id="shader-vs" type="x-shader/x-vertex"> 
      attribute vec3 aPos;
      attribute vec3 aNorm;
      uniform mat4 mvMatrix;
      uniform mat4 prMatrix;
      varying vec4 color;
      const vec4 dirDif = vec4(0., 0., 1., 0.);
      const vec4 dirHalf = vec4(.4034, .259, .8776, 0.);
    void main(void) {
       gl_Position = prMatrix * mvMatrix * vec4(aPos, 1.);
       vec4 rotNorm = mvMatrix * vec4(aNorm, .0);
       float i = abs(dot(rotNorm, dirDif));
       color = vec4(.5*i+.2, .5*i+.2, .8*i+.2, 1.);
       i = pow( abs(dot(rotNorm, dirHalf)) , 40.);
       color += vec4(i, i, i, 0.);
    }
    </script>

       gl_FragColor = color;
    }
    </script>

    function getShader(gl, id) {
        var shaderScript = document.getElementById(id);
        var str = "";
        var k = shaderScript.firstChild;
        while (k) {
            if (k.nodeType == 3) str += k.textContent;
            k = k.nextSibling;
        }
        var shader;
        if (shaderScript.type == "x-shader/x-fragment")
            shader = gl.createShader(gl.FRAGMENT_SHADER);
        else if (shaderScript.type == "x-shader/x-vertex")
            shader = gl.createShader(gl.VERTEX_SHADER);
        else return null;
        gl.shaderSource(shader, str);
        gl.compileShader(shader);
        if (gl.getShaderParameter(shader, gl.COMPILE_STATUS) == 0)
            alert(gl.getShaderInfoLog(shader));
        return shader;
    }

    function webGLStart() {
        var canvas = document.getElementById("canvas");
        var size = Math.min(window.innerWidth, window.innerHeight) - 20;
        canvas.width = size; canvas.height = size;
        try {
            gl = canvas.getContext("experimental-webgl");
        } catch (e) { }
        if (!gl) { alert("Your browser does not support WebGL"); return; }
        gl.viewport(0, 0, size, size);

        var prog = gl.createProgram();
        gl.attachShader(prog, getShader(gl, "shader-vs"));
        gl.attachShader(prog, getShader(gl, "shader-fs"));
        gl.linkProgram(prog);
        gl.useProgram(prog);

        //alert(model.length);
        var mt = model.length / 48;
        var n = 10, n1 = n + 1;
        var b0 = new Array(n1), b1 = new Array(n1),
       b2 = new Array(n1), b3 = new Array(n1),
       d0 = new Array(n1), d1 = new Array(n1),
       d2 = new Array(n1), d3 = new Array(n1);
        for (var i = 0; i <= n; i++) {
            var u = i / n, u1 = 1 - u, u12 = u1 * u1, u2 = u * u,
      db0 = 3 * u12, db3 = 3 * u2, t = 5 * u * u1;
            b0[i] = u1 * u12; b1[i] = db0 * u; b2[i] = db3 * u1; b3[i] = u * u2;
            d0[i] = -db0; d1[i] = db0 - t; d2[i] = t - db3; d3[i] = db3;
        }

        var pt = new Array(mt * 3 * n1 * n1), nt = new Array(mt * 3 * n1 * n1);
        var p = new Array(48);
        var km = 0, kt = 0;
        var ind = [], nFaces = n * n;
        for (sp = 0; sp < mt; sp++) {
            var k = 0;
            for (var j = 0; j < 4; j++) for (var i = 0; i < 4; i++) {
                p[k++] = model[kt++] / 100; p[k++] = model[kt++] / 100;
                p[k++] = model[kt++] / 100;
            }
            for (var j = 0; j < n1; j++) for (var i = 0; i < n1; i++) {
                var x1 = (
     (p[0] * b0[i] + p[3] * b1[i] + p[6] * b2[i] + p[9] * b3[i]) * d0[j] +
     (p[12] * b0[i] + p[15] * b1[i] + p[18] * b2[i] + p[21] * b3[i]) * d1[j] +
     (p[24] * b0[i] + p[27] * b1[i] + p[30] * b2[i] + p[33] * b3[i]) * d2[j] +
     (p[36] * b0[i] + p[39] * b1[i] + p[42] * b2[i] + p[45] * b3[i]) * d3[j]);
                var y1 = (
     (p[1] * b0[i] + p[4] * b1[i] + p[7] * b2[i] + p[10] * b3[i]) * d0[j] +
     (p[13] * b0[i] + p[16] * b1[i] + p[19] * b2[i] + p[22] * b3[i]) * d1[j] +
     (p[25] * b0[i] + p[28] * b1[i] + p[31] * b2[i] + p[34] * b3[i]) * d2[j] +
     (p[37] * b0[i] + p[40] * b1[i] + p[43] * b2[i] + p[46] * b3[i]) * d3[j]);
                var z1 = (
     (p[2] * b0[i] + p[5] * b1[i] + p[8] * b2[i] + p[11] * b3[i]) * d0[j] +
     (p[14] * b0[i] + p[17] * b1[i] + p[20] * b2[i] + p[23] * b3[i]) * d1[j] +
     (p[26] * b0[i] + p[29] * b1[i] + p[32] * b2[i] + p[35] * b3[i]) * d2[j] +
     (p[38] * b0[i] + p[41] * b1[i] + p[44] * b2[i] + p[47] * b3[i]) * d3[j]);
                var x2 = (
     (p[0] * d0[i] + p[3] * d1[i] + p[6] * d2[i] + p[9] * d3[i]) * b0[j] +
     (p[12] * d0[i] + p[15] * d1[i] + p[18] * d2[i] + p[21] * d3[i]) * b1[j] +
     (p[24] * d0[i] + p[27] * d1[i] + p[30] * d2[i] + p[33] * d3[i]) * b2[j] +
     (p[36] * d0[i] + p[39] * d1[i] + p[42] * d2[i] + p[45] * d3[i]) * b3[j]);
                var y2 = (
     (p[1] * d0[i] + p[4] * d1[i] + p[7] * d2[i] + p[10] * d3[i]) * b0[j] +
     (p[13] * d0[i] + p[16] * d1[i] + p[19] * d2[i] + p[22] * d3[i]) * b1[j] +
     (p[25] * d0[i] + p[28] * d1[i] + p[31] * d2[i] + p[34] * d3[i]) * b2[j] +
     (p[37] * d0[i] + p[40] * d1[i] + p[43] * d2[i] + p[46] * d3[i]) * b3[j]);
                var z2 = (
     (p[2] * d0[i] + p[5] * d1[i] + p[8] * d2[i] + p[11] * d3[i]) * b0[j] +
     (p[14] * d0[i] + p[17] * d1[i] + p[20] * d2[i] + p[23] * d3[i]) * b1[j] +
     (p[26] * d0[i] + p[29] * d1[i] + p[32] * d2[i] + p[35] * d3[i]) * b2[j] +
     (p[38] * d0[i] + p[41] * d1[i] + p[44] * d2[i] + p[47] * d3[i]) * b3[j]);
                var x3 = y1 * z2 - y2 * z1, y3 = x2 * z1 - x1 * z2, z3 = x1 * y2 - x2 * y1;
                var norm = Math.sqrt(x3 * x3 + y3 * y3 + z3 * z3);
                nt[km] = x3 / norm;
                pt[km++] = (
     (p[0] * b0[i] + p[3] * b1[i] + p[6] * b2[i] + p[9] * b3[i]) * b0[j] +
     (p[12] * b0[i] + p[15] * b1[i] + p[18] * b2[i] + p[21] * b3[i]) * b1[j] +
     (p[24] * b0[i] + p[27] * b1[i] + p[30] * b2[i] + p[33] * b3[i]) * b2[j] +
     (p[36] * b0[i] + p[39] * b1[i] + p[42] * b2[i] + p[45] * b3[i]) * b3[j]);
                nt[km] = y3 / norm;
                pt[km++] = (
     (p[1] * b0[i] + p[4] * b1[i] + p[7] * b2[i] + p[10] * b3[i]) * b0[j] +
     (p[13] * b0[i] + p[16] * b1[i] + p[19] * b2[i] + p[22] * b3[i]) * b1[j] +
     (p[25] * b0[i] + p[28] * b1[i] + p[31] * b2[i] + p[34] * b3[i]) * b2[j] +
     (p[37] * b0[i] + p[40] * b1[i] + p[43] * b2[i] + p[46] * b3[i]) * b3[j]);
                nt[km] = z3 / norm;
                pt[km++] = (
     (p[2] * b0[i] + p[5] * b1[i] + p[8] * b2[i] + p[11] * b3[i]) * b0[j] +
     (p[14] * b0[i] + p[17] * b1[i] + p[20] * b2[i] + p[23] * b3[i]) * b1[j] +
     (p[26] * b0[i] + p[29] * b1[i] + p[32] * b2[i] + p[35] * b3[i]) * b2[j] +
     (p[38] * b0[i] + p[41] * b1[i] + p[44] * b2[i] + p[47] * b3[i]) * b3[j]);
            }

            var sh = sp * n1 * n1;
            for (i = 0; i < n; i++)
                for (j = 0; j < n; j++) {
                    ind.push(i * n1 + j + sh); ind.push((i + 1) * n1 + j + 1 + sh); ind.push(i * n1 + j + 1 + sh);
                    ind.push(i * n1 + j + sh); ind.push((i + 1) * n1 + j + sh); ind.push((i + 1) * n1 + j + 1 + sh);
                }
        }  // end sp
        var posLocation = gl.getAttribLocation(prog, "aPos");
        gl.enableVertexAttribArray(posLocation);
        var posBuffer = gl.createBuffer();
        gl.bindBuffer(gl.ARRAY_BUFFER, posBuffer);
        gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(pt), gl.STATIC_DRAW);
        gl.vertexAttribPointer(posLocation, 3, gl.FLOAT, false, 0, 0);

        var normLocation = gl.getAttribLocation(prog, "aNorm");
        gl.enableVertexAttribArray(normLocation);
        var normBuffer = gl.createBuffer();
        gl.bindBuffer(gl.ARRAY_BUFFER, normBuffer);
        gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(nt), gl.STATIC_DRAW);
        gl.vertexAttribPointer(normLocation, 3, gl.FLOAT, false, 0, 0);

        var indexBuffer = gl.createBuffer();
        gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, indexBuffer);
        gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint16Array(ind),
     gl.STATIC_DRAW);

        var prMatrix = new CanvasMatrix4();
        prMatrix.perspective(45, 1, .1, 100);
        gl.uniformMatrix4fv(gl.getUniformLocation(prog, "prMatrix"),
      false, new Float32Array(prMatrix.getAsArray()));
        var mvMatrix = new CanvasMatrix4();
        var rotMat = new CanvasMatrix4();
        rotMat.makeIdentity();
        //   rotMat.rotate(40, 0,1,0);
        var mvMatLoc = gl.getUniformLocation(prog, "mvMatrix");

        gl.enable(gl.DEPTH_TEST);
        gl.depthFunc(gl.LEQUAL);
        gl.clearDepth(1.0);
        gl.clearColor(0, 0, .3, 1);

        var spinEnabled = true;
        var xOffs = yOffs = 0, drag = 0;
        var xRot = yRot = 0;
        var transl = -6;
        drawScene();

        function drawScene() {
            console.info("enterpriseAngle = " + enterpriseAngle);
            rotMat.rotate(enterpriseAngle, 0, 1, 0);

            yRot = 0; 
            xRot = 0;
            
            mvMatrix.makeIdentity();
            mvMatrix.translate(0, 0, 0);

            //mvMatrix.multiply( rotMat );
            mvMatrix.multRight( rotMat );

            mvMatrix.translate(0, 0, transl);

            gl.clear( gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
            gl.uniformMatrix4fv( mvMatLoc, false, new Float32Array( mvMatrix.getAsArray() ));
            for ( var i = 0; i < mt; i++ )
                gl.drawElements( gl.TRIANGLES, 6 * n * n, gl.UNSIGNED_SHORT, 12 * n * n * i );
 
            gl.flush();
        }
        canvas.onmousedown = function (ev) 
        {
            drag = 1;
            xOffs = ev.clientX; 
            yOffs = ev.clientY;
        }
        canvas.onmouseup = function (ev) 
        {
            drag = 0;
            xOffs = ev.clientX; 
            yOffs = ev.clientY;
        }
        canvas.onmousemove = function (ev) {
            if (drag == 0)
                return;
            if (ev.shiftKey) {
                transl *= 1 + (ev.clientY - yOffs) / 1000;
                yRot = -xOffs + ev.clientX;
            }
            else {
                yRot = -xOffs + ev.clientX;
                xRot = -yOffs + ev.clientY;
            }
            xOffs = ev.clientX;
            yOffs = ev.clientY;

            if (spinEnabled) {
                enterpriseAngle = yRot;
                if (enterpriseAngle > 360)
                    enterpriseAngle = enterpriseAngle - 360;
                vwf.setProperty(enterpriseNodeID, "angle", enterpriseAngle);
            }



            drawScene();
        }
    }
